g.script:
document.getElementById('Create-Segment-hover-target').addEventListener('mouseover', function() {
    document.querySelector('#Create-Segment-hover-target rect').setAttribute('fill', '#F4F6F9');
});
document.getElementById('Create-Segment-hover-target').addEventListener('mouseout', function() {
    document.querySelector('#Create-Segment-hover-target rect').setAttribute('fill', '#FFF');
});
document.getElementById('Create-Segment-hover-target').addEventListener('click', function() {
    navigatePage('/pacers#12');
});
